import logo from './logo.svg';
import './App.css';
import SignIn from './component/SignIn';
import { BrowserRouter, Route, Switch } from 'react-router-dom';
import Profile from './component/HomePage';


function App() {
  return <Profile/>
  const token = localStorage.getItem('accessToken');

  if(!token) {
    return <SignIn />
  }

  return (
    <div className="wrapper">
      <BrowserRouter>
        <Switch>
          <Route path="/profile">
            <Profile />
          </Route>
          <Route path="/">
            <Profile />
          </Route>
        </Switch>
      </BrowserRouter>
    </div>
  );
}

export default App;
